import React, {Component} from 'react';
import Title from "./Title";
import Topservice from "./Topservice";
import Advantage from "./Advantage";
import Topsells from "./Topsells";
import Client from "./Client";
import Parallax from "./Parallax";
import Slide from "./Slide";
import Catergory from "./Catergory";
import {
    BrowserRouter as Router,

} from 'react-router-dom'

class Home extends Component {
    render() {
        return (
            <div>
                <Slide/>
                <Title tieude="Dịch vụ" colr="teal" kieucd="zoom-in" />
                <Topservice/>
                <Title tieude="Thế mạnh" colr="orangred" kieucd="fade-up" />
                <Advantage/>
                <Catergory/>
                <Title tieude="Top giao diện bán nhiều nhất" colr="aquamarine" kieucd="zoom-in-down"/>
                <Topsells/>
                <Title tieude="Đối tác của chúng tôi" colr="navy" kieucd="zoom-out-down"/>
                <Client/>
                <Parallax/>
            </div>
        );
    }
}

export default Home;
